// Modules //
import React from 'react';
import axios from 'axios';
import Fade from 'react-reveal/Fade';

// Style //
import { Container, Col, Row, Card } from 'react-bootstrap';
import './Foot.scss';
import LinkedIn from './linkedin.png';
import BackToTop from "react-back-to-top-button";

class Contact extends React.Component {

  render() {
    return (
      <div className="div_foot">
        <BackToTop
        showOnScrollUp
        showAt={100}
        speed={1500}
        easing="easeInOutQuint"
      >
        <span>scroll up</span>
      </BackToTop>
        <Container>
            <Row>
                <Col>
                <Fade cascade>
                    <div className="foot_langue">Site realise a l'aide de ReactJS.</div>
                    <div className="foot_copy">Tout droit reserve blahblah.</div>
                </Fade>
                </Col>
                <Col>
                <Fade cascade>
                    <div className="foot_link"><a  href="https://www.linkedin.com/in/fiona-battaglia-0070911b2/"><img src={ LinkedIn } className="foot-linked" /></a></div>
                </Fade>
                </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Contact;
